import React, { useState, useContext, useRef } from 'react';

import { Container, PageTitle, Messages, Message, InputGroup, InputText, LabelInput, InputMessage, SendButtonInput, InputTextBox, Button } from './styles';

function Chat() {

    async function handleSubmit(event) {
        event.preventDefault();

    }

    return (
        <Container onSubmit={handleSubmit}>
            {/* <PageTitle>Chat websocket</PageTitle> */}

            <InputGroup>
                <LabelInput htmlFor="username">Username</LabelInput>

                <InputText
                    id="username"
                    required />
            </InputGroup>

            <Messages>
                <Message>
                    <b>20:00 </b>
                    <b>User01:</b> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc in viverra enim. Duis vel diam ac tortor volutpat commodo. Fusce leo ipsum, consectetur eget magna ut, eleifend sollicitudin justo.
                </Message>

                <Message>
                    <b>21:00 </b>
                    <b>User02:</b> Ut sodales sem eu elementum tristique. Curabitur ligula sem, imperdiet sit amet arcu eget, faucibus luctus purus. Vivamus justo urna, imperdiet ut elit vel, maximus placerat sapien.
                </Message>

                <Message>
                    <b>22:00 </b>
                    <b>User03:</b> Mauris viverra facilisis mi, elementum tincidunt lectus volutpat non. Etiam viverra ex turpis, in fermentum nibh mattis scelerisque. Duis nec congue justo.
                </Message>
            </Messages>

            <InputGroup>
                <InputMessage
                    id="message"
                    placeholder="Enviar mensagem..."
                    required />

                <SendButtonInput>Enviar</SendButtonInput>
            </InputGroup>

        </Container>
    );
}

export default Chat;
